import React from "react";
import Header from "./components/Layout/header";
import Meals from "./components/Meals/Meals";
import Modal from "./components/UI/Modal";


function App() {
  return <React.Fragment>
    <Modal></Modal>
    <Header></Header>
    <Meals></Meals>
  </React.Fragment>
}

export default App;
